#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <math.h>

int main() {
  char buf[20000] = {""};
  char *cur = buf;
  printf("%s\n%s\n%p\n", buf, cur, cur);
  cur = cur + 1;
  printf("%s\n%p\n%s\n%p\n", buf+1, buf+1, cur, cur);
  cur = cur + 9;
  printf("%s\n%p\n%s\n%p\n", buf+10, buf+10, cur, cur);
  return 0;
}

